var tipuesearch = {"pages": [{'title': 'About', 'text': 'This is  https://github.com/mdecourse/cmstemplate \n 目前的 cmsimde 在編輯器下方新增一個 csave 按鈕, 意即 collabrative save, 當動態網際管理系統在多人同時維護登入維護網頁內容時, 編輯各頁面時段, 該頁面可能已經改版, 因此使用 csave 按鈕存檔時, 會導入當下最新的該頁面內容, 並試圖與編輯中的頁面內容進行合併. \n 使用 csave 按鈕存檔無法刪除頁面資料. \n 使用 Edit All 模式, 無法使用 csave 按鈕（尚未測試). \n', 'tags': '', 'url': 'About.html'}, {'title': '作業', 'text': '', 'tags': '', 'url': '作業.html'}, {'title': 'heroku', 'text': '1. 建立 Heroku 帳號， 進入 \xa0 https://heroku.com ， 用學校電子郵件註冊一個 Heroku 帳號,，密碼設定必須要至少 8 個字元，且字元中必須包含符號.大小寫英文字母及數字其中三項， 並且登記後要進入電子郵件進行確認後才能開通 Heroku 帳號。 \n 2. 登入Heroku後，先以 s + 學號 建立一個 app，完成後，將可至 https://s學號.herokuapp.com 連線取得網站內容。 \n 3. 從\xa0 http://a.kmol.info:88/heroku.7z \xa0 下載 Heroku.zip 解開至隨身碟 Y:所在位置。 \n 4. 更改啟動檔，設定其存取路徑: \n @echo off\nset Disk=y\nsubst %Disk%: "data"\nset Local=%Disk%\\heroku\n\n%Disk%:\n\nset HomePath=%Disk%:\\home_ipv6\nset HomeDrive=%Disk%:\\home_ipv6\nset Home=%Disk%:\\home_ipv6\nset USERPROFILE=%Disk%:\\home_ipv6\n\nREM for heroku login\nset HTTP_PROXY=http://[2001:288:6004:17::69]:3128\nset HTTPS_PROXY=http://[2001:288:6004:17::69]:3128\n\nREM 將系統 Python 程式的 io 設為 utf-8\nset PYTHONIOENCODING="utf-8"\n\nset PYTHONPATH=%Disk%:\\Python39\\DLLs;%Disk%:\\Python39\\Lib;%Disk%:\\Python39\\Lib\\site-packages;\nset PYTHONHOME=%Disk%:\\Python39\n\nREM for ssh\nset GIT_SSH=%disk%:\\putty\\plink.exe\n\nREM 設定跟 Python 有關的命令搜尋路徑\nset path_python=%Disk%:\\Python39;%Disk%:\\Python39\\Scripts;\nset path_portablegit=%Disk%:\\Portablegit\\bin;\nset path_heroku=%Disk%:\\heroku\\bin;\n\npath=%Disk%:;%path_python%;%path_portablegit%;%path_heroku%;%path%;\nREGEDIT.EXE /S Y\\40923125.reg;\nstart /MIN cmd.exe\nstart /MIN cmd.exe\nstart /MIN cmd.exe\nstart /MIN cmd.exe\n\nstart /MIN %Disk%:\\wScite\\SciTE.exe\nstart /MIN %Disk%:\\wScite\\SciTE.exe\n\nExit \n 5. 測試是否能夠在命令列中執行 heroku.exe, 輸入 heroku version 若回應所使用的版本表示上述路徑設定已經成功.', 'tags': '', 'url': 'heroku.html'}]};